import Image from "react-bootstrap/Image"
import {Container, Row, Col} from "react-bootstrap"

const Home = () => {
    return (
        <div className="homePage">
            <Container className="d-flex justify-content-center align-items-center">
                <Row>
                    <Col>
                        <Image src="bo600.png" roundedCircle="true"/>
                    </Col>
                    <Col className="bio">
                        <h1>Thanks for visiting my site!</h1>
                        <p>A little about me, I am a Software Engineer 
                            graduate from McMaster University.
                            I am passionate about coding and started learning to code over 10 years ago.
                        </p>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Home;
